function authenticate(resp){
    return dispatch =>{
        console.log('AAAAAAAAAAAAAAAAaa',resp.payload);
        dispatch({
            type : 'authenticate',
            email : resp.payload.email,
            name  : resp.payload.name,
            mobile: resp.payload.mobile,
            image : resp.payload.image, 
        })
    }
}

export default {
    authenticate
}
